function setReviewStatus(review_id, status_id) {
  $.ajax({
      url: 'index.php?route=product/review|set_status',
      type:"POST",
      data: {review_id, status_id},
      // dataType: JSON,
      success:function(data){
          if (data.success) {
              $('.menu-toggle').removeClass('close');
              $('.menu-review').addClass('hide');
          }
      },
      error: function(error){
        // console.log(error);
      }
  });
}